import Link from 'next/link'

function Footer() {
  return (
    <footer style={navStyle}>

      <div>
        <p style={boldText}>Copyright &copy; 2019 </p>
        <p style={linkStyle}>Version 1.0.0</p>
      </div>

    </footer>
  )
}

const linkStyle = {
    textDecoration: 'none',
    weight: 'bold',
    color: '#000',
}

  const boldText = {
    textDecoration: 'none',
    weight: 'bold',
    color: '#fff',
    textAlign: 'center',
    marginRight: '10px'
}
  
  const navStyle = {
    background: '#05052b',
    position: 'fixed',
    bottom: '0',
    width: '100%',
    height: '80px',
    lineHeight: '80px',
    padding: '0 20px',
    textAlign: 'right',
    color: '#ffffff',

  }

export default Footer;
